{'super-study-id': 6, 'title': 'AtlantECO', 'description': 'The EU-funded AtlantECO project aims to develop and apply a novel, unifying framework that provides knowledge-based resources for a better understanding and management of the Atlantic Ocean and its ecosystem services. 

The project focuses on three pillars of research: microbiomes, plastic and the plastisphere, and seascape connectivity. 

This superstudy collects together the MGnify analyses of AtlantECO microbiome datasets and derived data.', 'image-url': '/metagenomics/images/atlanteco.png', 'biomes-count': 0}
